import React, { useState, useEffect } from "react";
import axios from "axios";

function Firstprofile({ setFirstProfile, firstProfile }) {
  const [loading, setLoading] = useState(true);
  let platform = "pc";
  let region = "us";
  let profile = "Koko-11570";
  const allStatsURL = `https://ow-api.com/v1/stats/${platform}/${region}/${profile}/complete`;

  useEffect(() => {
    const getData = async () => {
      const res = await axios.get(allStatsURL);
      console.log(res)
      setFirstProfile(res.data);
      setLoading(false);
    }
    getData()
  }, []);

  if (loading) {
    return <h1> Loading</h1>;
  } else {
    // console.log(firstProfile);
    return <div>{firstProfile.competitiveStats.rating}</div>;

  }
}

export default Firstprofile;
